import { Link } from "react-router-dom/cjs/react-router-dom.min"
import "./home.css"

export default function Home() {
  return (
    <div className="home">
      <div className="route">
          <div className="route1">
            <button className="btn1"><Link>"/register"</Link>Register</button>
          </div>
          <div className="route2">
            <button className="btn2"><a href="/login">Login</a></button>
          </div>
      </div>
    </div>
  );
}
